import React, { useState, useEffect } from 'react';

const Packages = () => {
    const [packaged, setPackages] = useState([]);

    useEffect(() => {
        fetch(`http://localhost:3020/api/packages/sort`)
            .then(respose => respose.json())
            .then(data => {
                setPackages(data.map(name => (
                    <div key={name.id} className="col-sm-5 col-md-4 col-lg-3">
                        <div>{name.name}</div>
                        <div>{name.location}</div>
                        <div>{name.price}</div>
                        <div>{name.persons}</div>
                        <div>{name.days}</div>
                        <div>{name.sort}</div>
                    </div>
                )));
            });
    }, []);
    return (<div>{packaged}</div>)
}
export default Packages;
